import React from 'react';
import Logo from '../assets/logoHenry.png'
import SearchBar from './SearchBar.jsx';
import './Nav.css';

function Nav({onSearch}) {
  return (
    <nav>
      <div>
        <div>
          <img src={Logo} alt="logo de Henry"/>
        </div>
      </div>
    </nav>
  );
};

export default Nav;
